import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the "Your Profile" link to be present
    // There are multiple "Your Profile" links; we want to click the one that triggers Jun's Profile
    // Try to find the one that works by clicking the first visible one and checking for Jun's profile content

    // Find all "Your Profile" links
    const profileLinks = await page.$$('a:text("Your Profile")');
    let found = false;
    let extractedData = {};

    for (let i = 0; i < profileLinks.length; i++) {
      // Scroll into view and click
      await profileLinks[i].scrollIntoViewIfNeeded();
      await profileLinks[i].click();

      // Wait for possible profile content to appear (Jun's profile full name)
      try {
        // Wait for the profile header with Jun's name (wait max 2s)
        await page.waitForSelector('div.profile-header h2', { timeout: 2000 });
        // Extract Jun's full name
        const fullName = await page.textContent('div.profile-header h2');
        if (fullName && fullName.toLowerCase().includes('jun')) {
          // Take screenshot after navigation
          await page.screenshot({ path: path.join(screenshotsDir, 'step_2_jun_profile.png') });
          screenshots.push(path.join(screenshotsDir, 'step_2_jun_profile.png'));

          // Extract more profile data
          const username = await page.textContent('div.profile-header .username');
          const bio = await page.textContent('div.profile-header .bio');
          const stats = await page.$$eval('div.profile-header .stat-number', els => els.map(e => e.textContent.trim()));
          const [orders, reviews, sellerRating] = stats;

          extractedData = {
            fullName: fullName.trim(),
            username: username ? username.trim() : null,
            bio: bio ? bio.trim() : null,
            totalOrders: orders,
            totalReviews: reviews,
            sellerRating: sellerRating
          };
          found = true;
          break;
        }
      } catch (e) {
        // Profile not found, try next link
      }
    }

    if (!found) {
      return {
        success: false,
        action: "Failed to navigate to Jun's Profile - Profile section not found after clicking all 'Your Profile' links",
        extractedData: {},
        screenshots,
        error: "Jun's profile not found"
      };
    }

    return {
      success: true,
      action: "Navigated to Jun's Profile and verified profile information",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
